import React, { Component } from 'react';

class Navbar extends Component{
    render(){
        return(
            <nav className="navbar bg-dark">
                <div className="container">
                    <img src={this.props.logo} alt="kebab" width={"30%"}/>
                </div>
            </nav>
        );
    }
}

export default Navbar;
